import { useContext } from 'react';
import { Navbar, Container, Row, Col, Image, Nav } from 'react-bootstrap';
import Link from 'next/link';

function Navigation(props) {
  const { isMobile } = useContext(AppContext);

  return (
    <div className="bg-white shadow-sm fixed-top">
      <Container>
        <Row>
          <Col>
            <Navbar bg="white" className="pl-0 pr-0">
              <Link href="!#">
                <a className="navbar-brand">
                  <Image fluid src="./static/images/logo.png" />
                </a>
              </Link>
              <Nav className="ml-auto">
                <Link href="!#">
                  <a className="nav-link">All Service</a>
                </Link>
                <Link href="!#">
                  <a className="nav-link">Login</a>
                </Link>
              </Nav>
            </Navbar>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Navigation;
